import "./App.css";




const Header = () => {
  return(
    <div className="header"></div>
  );
}
const Navi = () => {
  return(
    <div className="navi"></div>
  );
}
const Body = () => {
  return(
    <div className="body"></div>
  );
}
const footer = () => {
  return(
    <div className="body"></div>
  );
}


function App() {
  return (
    <div className="container">
      <Header/>
      <Navi />
      <Body />
      <div className="footer"></div>
    </div>
  );
}

export default App;
